INSERT INTO `sed_news` (`id`, `creator`, `content`, `photo`, `simpleText`, `created_date`) VALUES
  (1, 2, 11, 'http://fpmi.bsu.by/sm_full.aspx?guid=41673', '', '2015-02-20 21:31:36'),
  (2, 2, 12, '', 'Выставка, посвященная 80-летию профессора кафедры теории вероятностей и математической статистики ФПМИ, доктора физико-математических наук, Медведева Геннадия Алексеевича, пройдет в аудитории 604 главного корпуса с 16 по 27 февраля 2015г.', '2015-02-20 21:36:40'),
  (4, 3, 14, 'http://img.tyt.by/620x620s/n/it/0b/1/pvt-2012-3.jpg', 'Сегодня Министерство финансов высказало свое мнение по поводу возможного повышения ставки подоходного налога и размера облагаемой взносами в бюджет ФСЗН части дохода для работников Парка высоких технологий (ПВТ). Информация размещена на сайте ведомства. ', '2015-02-20 22:10:19'),
  (6, 2, 16, 'http://img.tyt.by/320x0s/n/it/00/4/pvt-2012-2-340.jpg', 'Руководители компаний - резидентов Парка высоких технологий решили не индексировать зарплату сотрудникам в декабре и январе, сообщает сайт ПВТ.\n\n', '2015-02-21 09:55:36'),
  (7, 2, 23, 'http://img.tyt.by/620x620s/n/reuters/01/4/frank-valter-shtaynmayer.jpg', 'В борьбе за право толкования событий, происходящих в ходе конфликта в Украине, внешнеполитическое ведомство Германии подготовило для своих сотрудников проверку некоторых тезисов на соответствие реальности. "Российские утверждения - наши ответы" - так озаглавлен один из документов Министерства иностранных дел. На хорошо известные тезисы России даются детальные ответы. Но вот в чем проблема: чем более прямым является российский тезис, тем более сложным получается немецкий ответ, пишет Spiegel.\n', '2015-02-22 19:48:33');

